According to [The ngAnimate Documentation](https://docs.angularjs.org/api/ngAnimate/#applying-directive-specific-styles-to-an-animation), it's possible to optionally specify animation `to` and `from` prameters in an object that can optionally be passed in to `animate` `enter` `leave` `addClass` `removeClass` and `setClass`

example usage from the documentation:

```
canvas.on('click', function(e) {
  $animate.addClass(element, 'on', {
    from: {
       position: 'absolute',
       left: '0px',
       top: '0px'
    },
     to: {
       left : e.client.x + 'px',
       top : e.client.y + 'px'
     }
   }):
 });
```

Currently the typedefs do not expose this, functionality, and this it looks like it's not possible.

